Ink Girls (2013)

Wicked Pictures and award-winning director Brad Armstrong bring you INK GIRLS, an ALL SEX ink-splattering extravaganza, featuring the hottest and most tatted vixens in the adult industry.Tattoo artists from all over the planet have used these beautiful women as their canvas, and now you get to see them up close and personal doing all kinds of dirty deeds. Sleeves, full back pieces, tribal, traditional, black &amp; white, and of course the ever popular Tramp Stamp they are all here, decorating the best bodies in town. So if you like your ladies a little more colorful than most, you are gonna love INK GIRLS.

Christy Mack, Daisy Marie, Gia Dimarco, Helly Hellfire, Jessa Rhodes, Kayla Carrera, Lolly Ink, Romi Rain, Sarah Jessie

